import React from "react";

export const FlowerCartAddress = () => {
  return (
    <article className="Flowers__Cart__Address">
      <input type="address" />
      <select>
        <option>12-14</option>
        <option>14-16</option>
        <option>16-18</option>
        <option>18-20</option>
        <option>20-22</option>
      </select>
    </article>
  );
};
